    <style>
      html, body {
        padding: 0;
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: "Lato", sans-serif;
        color: #EEEEEE;
        overflow: hidden;
      }
      #viewDiv {
        margin:0;
        padding:0;
        width:100%;
        height:100%;
      }
      .plot-container {
        top: 0;
        left: 0;
        z-index:98;
        background-color: #393e46;
        overflow: hidden;
        position: absolute;
        height: 100%;
      }

      .popup {
        top: 0;
        left: 0;
        z-index:50;
        background-color: #393e46;
        overflow: hidden;
        position: absolute;
        transition: 0.5s;
        opacity: 0.8;
        border-radius: 5px;
        border: 1px solid black;
      }
      .tools-btn {
        font-size: 18px;
        cursor: pointer;
        z-index: 99;
        position: absolute;
        right: 2%;
        top: 2%;
        color: #EEEEEE;
      }
      
      .tools-btn:hover {
        color: #4ecca3;
      }
      
      .tools-btn:active {
        color: #4d6dcb;
      }

      .plt-ctn {
        margin: 0;
        position: absolute;
        width:100%;
        height:65%;
        padding: 1px;
        top: 0;
      }

      .disable {
        top: 0;
        left: 0;
        z-index:80;
        opacity: 0.2;
        background-color: #393e46;
        overflow: hidden;
        position: absolute;
      }

      .control {
        overflow: hidden;
        position: absolute;
      }

      .warning {
        position: absolute;
        overflow: hidden;
        z-index: 99;
        top: 0;
        left: 0;
        opacity: 0.5;
        background-color: #FF0000;
        transition: 0.5s;
        width: 100%;
        height: 0;
      }

      #sliderDiv {
        position: absolute;
        z-index: 1;
        bottom: 0;
        border: 1px solid black;
        background-color: #FEFEFE;
        height: 50px;
        width: 100%;
      }

      table, td, tr, th {
        border: 1px solid #EEEEEE;
        border-collapse: collapse;
        padding 1px;
        font-size: 12px;
      }

      .tab {
        overflow: hidden;
        background-color: inherit;
        padding: 5px;
      }

      .tab button {
        background-color: inherit;
        color: #eeeeee;
        float: left;
        border: 1px solid #eeeeee;
        outline: none;
        cursor: pointer;
        padding: 14px 16px;
        transition: 0.3s;
      }

      .tab button:hover {
        background-color: #444444;
      }
      
      .tab button.active {
        background-color: #333333;
      }

      .equation {
        font-size: 11px;
      }

        var y = [];

        var a = terms[2];

        plot_bgcolor: 'rgba(0,0,0,0)',
        font: {
          family: 'Times New Roman, Times, serif',
          size: 12,
          color: '#EEEEEE'
        },
      };
      Plotly.newPlot('graph', [conf,died], plot_layout, {displaylogo:false});
      openWarningGeneric("Age data is severely limited and is likely biased.");
    }
    function updateCompare() {
      showControls('compare-control')
      var data = []
      
        var e = document.getElementById('country-select0')
        var thresh = parseInt(document.getElementById('case_thresh').value)
        var name = e[e.selectedIndex].text;
        var country = all_data[name];
        var f = firstCase(country.confirmed, thresh);
        var l = country.confirmed.length;
        var y = country.confirmed.slice(f,l);
        var d = {
          y: y,
          mode: 'lines+markers',
          name: name,
        };
        data.push(d);
      
        var e = document.getElementById('country-select1')
        var thresh = parseInt(document.getElementById('case_thresh').value)
        var name = e[e.selectedIndex].text;
        var country = all_data[name];
        var f = firstCase(country.confirmed, thresh);
        var l = country.confirmed.length;
        var y = country.confirmed.slice(f,l);
        var d = {
          y: y,
          mode: 'lines+markers',
          name: name,
        };
        data.push(d);
      
      var scale = (LOG_SCALE ? 'log' : 'linear');
      var plot_layout = {
        title: "Growth Comparison",
        yaxis: {
          type: scale,
          title: "Cases",
          automargin: true,
        },
        xaxis: {
          title: "Days",
          automargin: true,
        },
        paper_bgcolor: 'rgba(0,0,0,0)',
        plot_bgcolor: 'rgba(0,0,0,0)',
        font: {
          family: 'Times New Roman, Times, serif',
          size: 12,
          color: '#EEEEEE'
        },
      };
      Plotly.newPlot('graph', data, plot_layout, {displaylogo:false});
    }
    function update() {
      hideControls();
      if(PLOT_TYPE == "TRACE") {
        updatePlot();
      } else if(PLOT_TYPE == "COMPARE") {
        updateCompare();
      } else if(PLOT_TYPE == "HIST") {
        updateHistogram();
      }
      updateTable();
    }
    function openPlot() {
      var elem = document.getElementById("plotDiv");
      var style = elem.style;
      style.padding="15px";
      style.width = "75%";
      style.height = "100%";
      update();
    }
    function toggleLog() {
      LOG_SCALE = !LOG_SCALE;
      update();
    }
    function setSelectValues(value) {
      
        var el = document.getElementById("country-select0");
        for (var i = 0; i < el.options.length; i++) {
          if (el.options[i].text === value) {
            el.selectedIndex = i;
            break;
          }
        }
      
        var el = document.getElementById("country-select1");
        for (var i = 0; i < el.options.length; i++) {
          if (el.options[i].text === value) {
            el.selectedIndex = i;
            break;
          }
        }
      
    }
</script>
